Notifico que a empresa supracitada foi inspecionada para a renovação do Alvará Sanitário 2025-2026. Os itens avaliados foram:
- Documentos legais;
- Qualificação de veículos;
- Procedimentos operacionais;
- Sistemas informatizados utilizados;
- Certificados de calibração
As considerações finais serão emitidas posteriormente no final da inspeção.
